    [],nt"revision_timestamp": "2016-07-27T22:41:06.208094",nt"name": "estradiol-and-testosterone-11-kt-concentrations-in-catfish-associated-with-wastewater-disc",nt"isopen":
    false,nt"url": null,nt"notes": "In 1995, the U.S. Fish and Wildlife Service
    (Service) began to investigate concerns over thedischarge of wastewater from the
    Starkville Wastewater Treatment Plant (SWTP) into HollisCreek, a tributary of the
    Noxubee River. Both Hollis Creek and the Noxubee River flow throughNoxubee National
    Wildlife Refuge (NNWR). The Service was concerned with possible adverseeffects to
    fish and wildlife resources on the refuge resulting from the point-source discharge.The
    Service initiated a contaminants study in 1997 to examine possible effects from
    thedischarge on fish and wildlife resources of Hollis Creek and Noxubee River within
    and adjacentto NNWR. The purpose of the study was to:1) Determine effects on macroinvertebrate
    community of Hollis Creek,2) Determine nutrient levels in water samples from Hollis
    Creek,3) Determine concentrations of heavy metal and organochlorine pesticides in
    sediment,fish, wood ducks, and raccoons.",nt"license_title": "License Not
